2:3291:2215.docs:
Provides type based access to context intended for error reports.

Used in conjunction with [`Demand::provide_value`] and [`Demand::provide_ref`] to extract
references to member variables from `dyn Error` trait objects.

# Example

```rust
#![feature(provide_any)]
#![feature(error_generic_member_access)]
use core::fmt;
use core::any::Demand;

#[derive(Debug)]
struct MyBacktrace {
    // ...
}

impl MyBacktrace {
    fn new() -> MyBacktrace {
        // ...
        # MyBacktrace {}
    }
}

#[derive(Debug)]
struct SourceError {
    // ...
}

impl fmt::Display for SourceError {
    fn fmt(&self, f: &mut fmt::Formatter<'_>) -> fmt::Result {
        write!(f, "Example Source Error")
    }
}

impl std::error::Error for SourceError {}

#[derive(Debug)]
struct Error {
    source: SourceError,
    backtrace: MyBacktrace,
}

impl fmt::Display for Error {
    fn fmt(&self, f: &mut fmt::Formatter<'_>) -> fmt::Result {
        write!(f, "Example Error")
    }
}

impl std::error::Error for Error {
    fn provide<'a>(&'a self, demand: &mut Demand<'a>) {
        demand
            .provide_ref::<MyBacktrace>(&self.backtrace)
            .provide_ref::<dyn std::error::Error + 'static>(&self.source);
    }
}

fn main() {
    let backtrace = MyBacktrace::new();
    let source = SourceError {};
    let error = Error { source, backtrace };
    let dyn_error = &error as &dyn std::error::Error;
    let backtrace_ref = dyn_error.request_ref::<MyBacktrace>().unwrap();

    assert!(core::ptr::eq(&error.backtrace, backtrace_ref));
}
```

2:8863:3118.docs:
Creates an iterator which can use the [`peek`] and [`peek_mut`] methods
to look at the next element of the iterator without consuming it. See
their documentation for more information.

Note that the underlying iterator is still advanced when [`peek`] or
[`peek_mut`] are called for the first time: In order to retrieve the
next element, [`next`] is called on the underlying iterator, hence any
side effects (i.e. anything other than fetching the next value) of
the [`next`] method will occur.


# Examples

Basic usage:

```
let xs = [1, 2, 3];

let mut iter = xs.iter().peekable();

// peek() lets us see into the future
assert_eq!(iter.peek(), Some(&&1));
assert_eq!(iter.next(), Some(&1));

assert_eq!(iter.next(), Some(&2));

// we can peek() multiple times, the iterator won't advance
assert_eq!(iter.peek(), Some(&&3));
assert_eq!(iter.peek(), Some(&&3));

assert_eq!(iter.next(), Some(&3));

// after the iterator is finished, so is peek()
assert_eq!(iter.peek(), None);
assert_eq!(iter.next(), None);
```

Using [`peek_mut`] to mutate the next item without advancing the
iterator:

```
let xs = [1, 2, 3];

let mut iter = xs.iter().peekable();

// `peek_mut()` lets us see into the future
assert_eq!(iter.peek_mut(), Some(&mut &1));
assert_eq!(iter.peek_mut(), Some(&mut &1));
assert_eq!(iter.next(), Some(&1));

if let Some(mut p) = iter.peek_mut() {
    assert_eq!(*p, &2);
    // put a value into the iterator
    *p = &1000;
}

// The value reappears as the iterator continues
assert_eq!(iter.collect::<Vec<_>>(), vec![&1000, &3]);
```
[`peek`]: Peekable::peek
[`peek_mut`]: Peekable::peek_mut
[`next`]: Iterator::next

1:5499:58464.docs:
Reads the exact number of byte required to fill `buf` from the given offset.

The offset is relative to the start of the file and thus independent
from the current cursor.

The current file cursor is not affected by this function.

Similar to [`io::Read::read_exact`] but uses [`read_at`] instead of `read`.

[`read_at`]: FileExt::read_at

# Errors

If this function encounters an error of the kind
[`io::ErrorKind::Interrupted`] then the error is ignored and the operation
will continue.

If this function encounters an "end of file" before completely filling
the buffer, it returns an error of the kind [`io::ErrorKind::UnexpectedEof`].
The contents of `buf` are unspecified in this case.

If any other read error is encountered then this function immediately
returns. The contents of `buf` are unspecified in this case.

If this function returns an error, it is unspecified how many bytes it
has read, but it will never read more than would be necessary to
completely fill the buffer.

# Examples

```no_run
use std::io;
use std::fs::File;
use std::os::unix::prelude::FileExt;

fn main() -> io::Result<()> {
    let mut buf = [0u8; 8];
    let file = File::open("foo.txt")?;

    // We now read exactly 8 bytes from the offset 10.
    file.read_exact_at(&mut buf, 10)?;
    println!("read {} bytes: {:?}", buf.len(), buf);
    Ok(())
}
```

